import "./App.css";
import {MusicApi} from "./components/MusicApi.js"
import { useRef, useState } from "react";
import PianoRoll from "react-piano-roll";

export default function App() {
  const [state, setState] = useState(0);
  const playbackRef = useRef();
  window.addEventListener("keydown", ({ key }) => {
    if (playbackRef.current === undefined) {
      return;
    } else if (key === " ") {
      playbackRef.current.toggle();
    } else if (key === "Enter") {
      playbackRef.current.seek("0:0:0");
    }
  });
    let data = {
        "id": 0,
        "clip_id": 0,
        "detail_clip_id": 0,
        "note_density": 0.1,
        "tempo": 120,
        "case": "start",
        "top_p": 0.949999988079071,
        "superconditioning": 1,
        "clip_start": 0.0,
        "clip_end": 5,
        "selected_region": {
            "start": 1,
            "end": 2
        },
        "notes": [
            "notes",
            1,
            "note",
            76,
            0.0,
            0.0,
            120,
            0
        ]
    }
    const requestOptions = {
        method: 'POST',
        headers: {"Content-type": "application/json"},
        body: JSON.stringify(data)
    };
    let response = fetch('https://pia.api.cslmusic.team/', requestOptions);
    console.log('fpzakpofk');

    return (
        <div className="App">
      <PianoRoll
        width={810}
        height={400}
        zoom={6}
        // resolution={2}
        gridLineColor={0x333333}
        blackGridBgColor={0x1e1e1e}
        whiteGridBgColor={0x282828}
        noteData={[
          ["0:0:0", "C4", "2n"],
          ["0:0:0", "D4", "2n"],
          ["0:0:0", "E4", "2n"],
          ["0:2:0", "B4", "4n"],
          ["0:3:0", "A#4", "4n"]
        ]}
        ref={playbackRef}
      />
      <button onClick={() => setState(state + 1)}>set state</button>
          <MusicApi />
    </div>
  );
}
